Zamów album: https://preorder.pl/bonson-cd
Sprawdź digital: https://digitalmusic.lnk.to/dzieciakiwinnychnajkach

„Brudnopis”, czyli długogrający album Bonsona wydawany we współpracy ze Step Records, w drodze! „Dzieciaki w innych najkach” to pierwszy singiel promujący to wydawnictwo, a jednocześnie pierwszy wspólny kawałek Bonsona i Sokoła. Więcej informacji o projekcie „Brudnopis” znaleźć można na Preorder.pl. 

